import { useContext } from "react"
import { ProductContaxt } from "./ProductProvider"

function Product() {
    const contaxt = useContext(ProductContaxt)
    console.log(contaxt);
    return (
        <div>
            <h1>{contaxt.title}</h1>
            {contaxt.data.map((item, i) => {
                return <h2 key={i}>{item}</h2>
            })}
        </div>
    )
}
export default Product
